DATA_8BE881:
	db "DON'T LOOK NOW, MON!",$80
	db "KEELHAUL PETE, DE",$80
	db "DREADED PIRATE KING, HAS",$81
	db "RETURNED!",$00

DATA_8BE8CB:
	db "WE THOUGHT",$80
	db "KEELHAUL PETE WAS",$80
	db "SWALLOWED BY A WHALE,",$81
	db "BUT HE'S BACK",$80
	db "AND HE'S BROUGHT A CABIN",$80
	db "BOY WIT' HIM!",$00

DATA_8BE933:
	db "YOU KNOW, SPOONERVILLE",$80
	db "ISLAND USED TO BE A SAFE",$80
	db "PLACE--BEFORE",$81
	db "OL' KEELHAUL PETE",$80
	db "GOT OUTTA DAT WHALE!",$00

DATA_8BE998:
	db "SINCE KEELHAUL PETE AND",$80
	db "DAT WICKED PARTNER OF",$80
	db "HIS LANDED, PIRATES BEEN",$81
	db "TRYING TO TAKE OVER",$80
	db "SPOONERVILLE ISLAND!",$00

DATA_8BEA08:
	db "YOU GONNA NEED A BRIDGE",$80
	db "TO MAKE IT ACROSS HERE.",$00

DATA_8BEA38:
	db "MAYBE DAT WOODEN BOARD",$80
	db "ON THE OTHER SIDE WILL",$80
	db "WORK.",$00

DATA_8BEA6C:
	db "YOU CAN USE DE SHOVEL",$80
	db "OVER THERE. MAYBE YOU'LL",$80
	db "FIND SOME HIDDEN PIRATE",$81
	db "TREASURE!",$00

DATA_8BEABD:
	db "HOLY SMOKE! LOOK WHAT",$80
	db "THEY'VE DONE TO MY FARM!",$80
	db "OH, I WISH KEELHAUL PETE",$81
	db "HAD STAYED IN DAT WHALE!",$00

DATA_8BEB1E:
	db "SWITCH PLATES: PUSH THE",$80
	db "SWITCHES IN THE CORRECT",$80
	db "COMBINATION.",$00

DATA_8BEB5B:
	db "THOSE VILE PIRATES HAVE",$80
	db "TAKEN SOME OF OUR PEOPLE",$80
	db "PRISONER ON THEIR SHIP,",$81
	db "MON! IF THEY TRY TO GO",$80
	db "FREE, DE PIRATES GONNA",$80
	db "BURN OUR VILLAGE TO DE",$81
	db "GROUND!",$00

DATA_8BEBF1:
	db "YOU KNOW MON,",$80
	db "I REMEMBER WHEN THIS",$80
	db "USED TO BE A PRETTY GOOD",$81
	db "VACATION SPOT.",$80
	db "THEN KEELHAUL PETE WENT",$81
	db "AND GOT OUTTA",$80
	db "DAT WHALE...",$00

DATA_8BEC6F:
	db "DE PIRATES SAY THEIR",$80
	db "LONG LOST LEADER,",$80
	db "KEELHAUL PETE, IS BACK.",$81
	db "HE WAS ONCE THE SCOURGE",$80
	db "OF THE SEVEN SEAS--UNTIL",$81
	db "HE GOT SWALLOWED BY",$80
	db "A WHALE, DAT IS.",$00

DATA_8BED04:
	db "BEWARE THE PIRATES!",$80
	db "KEELHAUL PETE IS ON DE",$80
	db "LOOSE AGAIN!",$00

DATA_8BED3C:
	db "KEELHAUL PETE IS",$80
	db "FORCING US TO DO HIS",$80
	db "BIDDING!",$81
	db "BUT THERE'S SOMETHING",$80
	db "DIFFERENT ABOUT HIM...",$81
	db "MAYBE IT WAS JUST DE",$80
	db "WHALE.",$00

DATA_8BEDB4:
	db "THERE'S DEFINITELY",$80
	db "SOMETHING DIFFERENT",$80
	db "ABOUT KEELHAUL PETE.",$81
	db "MAYBE IT WAS JUST THE",$80
	db "WHALE.",$00

DATA_8BEE0D:
	db "AN IMPOSTER WAS",$80
	db "PRETENDING TO BE",$80
	db "KEELHAUL PETE!",$81
	db "NOW THEY'RE GONNA",$80
	db "MAKE HIM WALK DE PLANK!",$80
	db "AND HIS CABIN BOY TOO!",$00

DATA_8BEE7E:
	db "UH OH. THE IMPOSTER AND",$80
	db "HIS CABIN BOY ARE IN",$80
	db "DEEP TROUBLE!",$00

DATA_8BEEB9:
	db "THE PIRATES TOOK THE",$80
	db "IMPOSTER TO THEIR SHIP!",$80
	db "BETTER HURRY IF YOU WANT",$81
	db "TO CATCH THEM! THEY'RE",$80
	db "ABOUT TO WEIGH ANCHOR!",$00

DATA_8BEF2D:
	db "HURRY, THEY'RE ABOUT TO",$80
	db "WEIGH ANCHOR!",$00

DATA_8BEF53:
	db "NOW DE",$80
	db "REAL KEELHAUL PETE",$80
	db "HAS RETURNED!",$81
	db "DE WHALE WENT",$80
	db "AND SPIT HIM OUT!",$81
	db "THOSE IMPOSTERS ARE",$80
	db "DOOMED FOR SURE!",$00

DATA_8BEFC0:
	db "THOSE STAIRS AHEAD LEAD",$80
	db "TO DE UPPER DECK.",$00

DATA_8BEFEA:
	db "IT WAS A GREAT DAY FOR",$80
	db "FISHING IN SPOONERVILLE,",$80
	db "SO GOOFY AND HIS PALS",$81
	db "HEADED OUT TO THE OCEAN",$80
	db "WITH THEIR BOATS.",$00

DATA_8BF05A:
	db "CRUISING FOR THE BIG",$80
	db "ONES IN OPEN WATER, PETE",$80
	db "AND PJ WERE SUDDENLY",$81
	db "CAUGHT IN THE OMINOUS",$80
	db "SHADOW OF A GIGANTIC",$80
	db "SHIP.",$00

DATA_8BF0CE:
	db "WHEN GOOFY AND MAX",$80
	db "LOOKED UP, THEY SAW A",$80
	db "HUGE PIRATE SHIP HEADING",$81
	db "OUT TO SPOONERVILLE",$80
	db "ISLAND. PETE AND PJ WERE",$80
	db "ONBOARD, VICTIMS OF",$81
	db "A PIRATE KIDNAPPING!",$00

DATA_8BF166:
	db "GOOFY ROWED FOR ALL HE",$80
	db "WAS WORTH, BUT HE",$80
	db "COULDN'T CATCH UP TO THE",$81
	db "PIRATE SHIP BEFORE IT",$80
	db "LANDED ON THE ISLAND.",$80
	db "DETERMINED TO RESCUE",$81
	db "THEIR FRIENDS, GOOFY AND",$80
	db "MAX SET OUT TO EXPLORE",$80
	db "THE ISLAND AND FIND THE",$81
	db "PIRATE STRONGHOLD.",$00

DATA_8BF244:
	db "GOOFY: NOW WAIT JUST A",$80
	db "SECOND, YOU--YOU",$80
	db "BULLIES! WHERE'D YOU",$81
	db "TAKE OUR PALS!?",$81
	db "PIRATES: PALS? WE DIDN'T",$80
	db "TAKE ANYONE ANYWHERE,",$80
	db "MATEY. WE THOUGHT OUR",$81
	db "PIRATE LEADER HAD BEEN",$80
	db "SWALLOWED BY A WHALE,",$80
	db "BUT WE JUST RESCUED HIM!",$81
	db "WHEN HE FINDS OUT WHAT",$80
	db "YOU'VE DONE TO US, AYE,",$80
	db "HE'LL COME LOOKING FOR",$81
	db "YOU FOR CERTAIN!",$81
	db "MAX: WOAH, I'M SHAKIN'",$80
	db "IN MY HIGH TOPS, DUDE.",$00

DATA_8BF3A1:
	db "MAX: HEY, DAD, COULD",$80
	db "THIS BE THE PIRATE",$80
	db "FORTRESS?",$81
	db "GOOFY: GAWRSH SON,",$80
	db "I DUNNO. LET'S KNOCK",$80
	db "ON THE DOOR AND ASK.",$00

DATA_8BF410:
	db "PETE: HAH! THEY THINK",$80
	db "WE'RE ROYALTY, PJ!",$80
	db "I KINDA LIKE BEING",$81
	db "A PIRATE KING!",$81
	db "PJ: SHH, DAD, THEY'LL",$80
	db "HEAR!",$81
	db "PETE: SERVANTS, MORE",$80
	db "FOOD! BEING STUCK IN",$80
	db "A WHALE SURE MAKES YOU",$81
	db "HUNGRY! HAH!",$00

DATA_8BF4C5:
	db "MAX: LOOK, DAD, THERE'S",$80
	db "THE PIRATE SHIP!",$00

DATA_8BF4EE:
	db "GOOFY: AND THERE'S PETE!",$80
	db "DON'T WORRY. I'LL SAVE",$80
	db "YA, NEIGHBOR!",$00

DATA_8BF52C:
	db "GOOFY: WHOAH!",$00

DATA_8BF53A:
	db "GOOFY: OOPS. UH, SORRY,",$80
	db "PETE. HEY, WHERE'D YA",$80
	db "GET THAT SWELL OUTFIT?",$81
	db "MAX: DAD, THAT'S NOT MR.",$80
	db "P! THAT'S...",$80
	db "THE PIRATE KING!!",$81
	db "GOOFY: UH-OH. THE",$80
	db "PIRATES MUST THINK PETE",$80
	db "IS THEIR LEADER! THEY",$81
	db "SURE ARE GONNA BE SORE",$80
	db "WHEN THEY FIND OUT HE'S",$80
	db "A USED CAR SALESMAN.",$81
	db "MAX: WE'VE GOTTA HELP",$80
	db "THEM!",$00

DATA_8BF657:
	db "GOOFY: WELL, WE GOT THE",$80
	db "BAD GUYS, BUT I WONDER",$80
	db "WHERE PETE AND PJ ARE?",$81
	db "GAWRSH, I SURE HOPE",$80
	db "THIS WAS THE RIGHT",$80
	db "PIRATE SHIP.",$81
	db "MAX: I HOPE THE PIRATES",$80
	db "DIDN'T MAKE SHARK FOOD",$80
	db "OUT OF THEM!",$81
	db "PETE: SOMEBODY GET OVER",$80
	db "HERE AND HELP US!",$81
	db "GOOFY: HEY! THAT SOUNDED",$80
	db "LIKE PETE. C'MON!",$00

DATA_8BF762:
	db "MAX: OH NO! THEY'RE",$80
	db "SERVIN' A MR. P-AND-PJ",$80
	db "COMBO PLATTER TO THAT",$81
	db "ALLIGATOR!",$81
	db "GOOFY: HMM... THAT'S",$80
	db "STRANGE. IT'S NOT EVEN",$80
	db "DINNER TIME YET.",$81
	db "PJ/PETE: HELP US!!",$81
	db "GOOFY: GIVE ME A HAND",$80
	db "HERE, MAX. LET'S REEL ",$80
	db "'EM IN.",$00

DATA_8BF833:
	db "GOOFY: NOTHIN' LIKE A",$80
	db "RELAXIN' DAY OF FISHIN'",$80
	db ",EH MAX?",$81
	db "MAX: RIGHT, DAD!",$00

DATA_8BF87B:
	db "WE WILL SMASH YOU!",$00

DATA_8BF88E:
	db "WE WILL CRUSH!",$00

DATA_8BF89D:
	db "WE WILL BASH YOU!",$80
	db "INTO MUSH!",$00

DATA_8BF8BA:
